import React from 'react';
import { Link } from 'react-router-dom';

const RobotList = ({ robots }) => {
    return (
        <div className="justify-center">
            {robots.map((robot) => (
                <Link to={`/robot/${robot.id}`} key={robot.id}>
                    <div>
                        <h2 className="m-10">{robot.name}</h2>
                    </div>
                </Link>
            ))}
        </div>
    );
};

export default RobotList;
